<nav class="navbar navbar-expand-lg navbar-dark bg-dark">
  <a class="navbar-brand" href="#">SIDDHINATH HOSPITALS</a>

  <div class="ms-auto">
    <button class="btn btn-outline-light me-2" routerLink="/docdash">
      ← Back
    </button>
    <button class="btn btn-danger" (click)="logout()">
      Logout
    </button>
  </div>
</nav>

<div class="container mt-4">

  <!-- Loading -->
  <div *ngIf="loading" class="alert alert-info text-center">
    Loading patient details...
  </div>

  <!-- Error -->
  <div *ngIf="errorMessage" confirm class="alert alert-danger text-center">
    {{ errorMessage }}
  </div>

  <!-- Patient Card -->
  <div *ngIf="patient && !loading" class="card shadow-lg">

    <div class="card-header bg-primary text-white">
      <h4 class="mb-0">Patient Details</h4>
    </div>

    <div class="card-body">

      <div class="row mb-3">
        <div class="col-md-6">
          <strong>Patient ID:</strong>
          <p>{{ patient.id }}</p>
        </div>
        <div class="col-md-6">
          <strong>Name:</strong>
          <p>{{ patient.name }}</p>
        </div>
      </div>

      <div class="row mb-3">
        <div class="col-md-4">
          <strong>Age:</strong>
          <p>{{ patient.age }}</p>
        </div>
        <div class="col-md-4">
          <strong>Blood Group:</strong>
          <p>{{ patient.blood }}</p>
        </div>
        <div class="col-md-4">
          <strong>Urgency:</strong>
          <span class="badge bg-warning text-dark">
            {{ patient.urgency }}
          </span>
        </div>
      </div>

      <div class="row mb-3">
        <div class="col-md-6">
          <strong>Prescription:</strong>
          <p>{{ patient.prescription }}</p>
        </div>
        <div class="col-md-6">
          <strong>Dose:</strong>
          <p>{{ patient.dose }}</p>
        </div>
      </div>

      <div class="row">
        <div class="col-md-6">
          <strong>Fees:</strong>
          <p class="text-success fw-bold">₹ {{ patient.fees }}</p>
        </div>
      </div>

    </div>

    <div class="card-footer text-end">
      <button class="btn btn-secondary me-2" routerLink="/docdash">
        Back
      </button>
      <button class="btn btn-primary" routerLink="/appointmentlist">
        View Appointments
      </button>
    </div>

  </div>
</div>
